class Contacts {  Contacts._();  Contacts.fromJson(dynamic json) {    id = json['id'];    phone = json['phone']??'';    addressRu = json['address_ru'];    addressUz = json['address_uz'];    workUz = json['work_uz'];    workRu = json['work_ru'];    telegram = json['telegram'];    instagram = json['instagram'];  }  late  int id;   String phone = '';  late  String addressRu;  late  String addressUz;  late  String workUz;  late  String workRu;  late  String telegram;  late  String instagram;  Map<String, dynamic> toJson() {    final map = <String, dynamic>{};    map['id'] = id;    map['phone'] = phone??'';    map['address_ru'] = addressRu;    map['address_uz'] = addressUz;    map['work_uz'] = workUz;    map['work_ru'] = workRu;    map['telegram'] = telegram;    map['instagram'] = instagram;    return map;  }}